Căn cứ theo Điều 6 Nghị định 110/2018/NĐ-CP quy định về trách nhiệm của người tham gia lễ hội như sau:
- Chấp hành nghiêm các quy định của pháp luật; nội quy thực hiện nếp sống văn minh trong lễ hội;
- Ứng xử có văn hóa trong hoạt động lễ hội; trang phục lịch sự, phù hợp với thuần phong mỹ tục của dân tộc Việt Nam; không nói tục, chửi thề xúc phạm tâm linh, gây ảnh hưởng xấu tới không khí trang nghiêm của lễ hội;
- Thắp hương, đốt vàng mã đúng nơi quy định; không chen lấn, xô đẩy gây mất trật tự an ninh; giữ gìn vệ sinh môi trường;
- Không tổ chức hoặc tham gia các hoạt động mê tín, dị đoan, cờ bạc và các hành vi vi phạm pháp luật khác.
- Không thực hiện việc đổi tiền có chênh lệch giá trong khu vực di tích, lễ hội;
- Cán bộ, công chức, viên chức, người lao động ngoài việc chấp hành nghiêm quy định tại các quy định trên còn phải thực hiện các quy định sau:
+ Không đi lễ hội trong giờ hành chính;
+ Không dùng xe công và các phương tiện công (hoặc thuê khoán phương tiện) tham gia lễ hội (trừ trường hợp thuộc thành phần tham gia tổ chức lễ hội hoặc được giao thực thi nhiệm vụ).

Căn cứ theo Điều 177 Thông tư 06/2025/TT-BCT quy định về quan hệ công tác trong xử lý sự cố hệ thống điện quốc gia như sau:
- Quan hệ công tác giữa Nhân viên vận hành cấp dưới và Nhân viên vận hành cấp trên
+ Nhân viên vận hành cấp dưới phải chấp hành các mệnh lệnh của Nhân viên vận hành cấp trên. Đối với những lệnh có nguy cơ đe dọa đến tính mạng con người và an toàn thiết bị thì được phép chưa thực hiện nhưng phải báo cáo Nhân viên vận hành cấp trên;
+ Nhân viên vận hành cấp trên có quyền đề nghị Lãnh đạo trực tiếp của Nhân viên vận hành cấp dưới thay thế Nhân viên vận hành này trong trường hợp có đầy đủ lý do cho thấy Nhân viên vận hành cấp dưới không đủ năng lực xử lý sự cố hoặc vi phạm nghiêm trọng quy chuẩn kỹ thuật, quy trình liên quan.
- Quan hệ công tác giữa Nhân viên vận hành cấp dưới với Nhân viên vận hành cấp trên và Lãnh đạo trực tiếp của Nhân viên vận hành cấp dưới
+ Lãnh đạo trực tiếp của Nhân viên vận hành cấp dưới có quyền ra lệnh cho Nhân viên vận hành dưới quyền mình để xử lý sự cố, nhưng lệnh đó không được trái với lệnh của Nhân viên vận hành cấp trên và quy chuẩn kỹ thuật, tiêu chuẩn, quy định khác có liên quan;
+ Khi lệnh của Lãnh đạo trực tiếp trái với lệnh của Nhân viên vận hành cấp trên, Nhân viên vận hành cấp dưới có quyền không thi hành lệnh của Lãnh đạo trực tiếp và báo cáo Nhân viên vận hành cấp trên, trừ trường hợp có nguy cơ đe dọa đến tính mạng con người và an toàn thiết bị;
+ Khi có đầy đủ lý do cho thấy Nhân viên vận hành không đủ năng lực xử lý sự cố, Lãnh đạo trực tiếp có quyền tạm đình chỉ công tác Nhân viên vận hành trong ca trực đó, tự mình xử lý sự cố hoặc chỉ định Nhân viên vận hành khác thay thế, đồng thời báo cáo cho Nhân viên vận hành cấp trên biết.
- Nghiêm cấm những người không có nhiệm vụ vào phòng điều khiển khi Nhân viên vận hành đang xử lý sự cố, trừ Lãnh đạo cấp trên có trách nhiệm, Lãnh đạo trực tiếp của đơn vị. Trường hợp cần thiết, Nhân viên vận hành hoặc Lãnh đạo trực tiếp của đơn vị có quyền yêu cầu cán bộ chuyên môn có liên quan đến việc xử lý sự cố đến phòng điều khiển của đơn vị để xử lý sự cố.
- Khi có sự cố nghiêm trọng, Nhân viên vận hành phải kịp thời báo cáo sự cố cho Lãnh đạo trực tiếp của đơn vị mình biết. Lãnh đạo trực tiếp có trách nhiệm báo cáo Lãnh đạo cấp trên hoặc các đơn vị có liên quan.
